import React, { useEffect, useState } from 'react'
import UpperHeading from '../../Components/UpperHeading'
import './Planets.css'

const Planets = () => {
    const [planets,setPlanets] = useState([])
    useEffect(()=>{
        fetch('https://swapi.dev/api/planets/?format=json')
        .then(response => response.json())
        .then(data => {
            setPlanets(data.results);
        })
        .catch(error=>{
            console.error("Error fetching Data",error)
        })
    },[])

  return (
    <div>
      <UpperHeading/>
      <div className="container">
        <div className="row">
            {
                planets.map(planet => (
                    <div key={planet.name} className="col-lg-4 planet-button-div mt-5 mb-5">
                        <button className='planet-button'>{planet.name}</button>
                    </div>
                ))
            }
        </div>
        <div className="row button-div mt-3">
            <button></button>
        </div>
      </div>
    </div>
  )
}

export default Planets
